import React ,{Component} from "react";
import { Map, GoogleApiWrapper, HeatMap } from "google-maps-react";
import {ReactComponent as Legend} from "../../common/probability.svg"

class MapHeat extends Component {
  render() {
    const gradient = [
      "rgba(0, 255, 255, 0)",
      "RGBA(147,236,80,0.7)",
      "RGBA(209,236,80,0.7)",
      "RGBA(255,236,80,0.7)",
      "RGBA(255,198,80,0.7)",
      "RGBA(255,132,80,0.7)",
      "rgba(191, 0, 31, 0.7)",
      "rgba(255, 0, 0, 0.8)"
    ];
    return (
      <div className="map-container">
        <Map
          google={this.props.google}
          className={"map"}
          zoom={5}
          initialCenter={this.props.center}
          onReady={this.handleMapReady}
        >
          <HeatMap
            gradient={gradient}
            positions={this.props.data}
            opacity={1}
            radius={20}
          />
        </Map>
        <Legend style={{marginTop: '7000px'}}/>
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyAFh1CM1cLQzlwpt7GDhufyCgwxmdh8I1Y",
  libraries: ["visualization"]
})(MapHeat);
